import React from "react";
import {swapi} from "../../services/swapi/SwapiService";
import {Record} from "../ItemDetalis/ItemDetalis";
import ItemDetalis from "../ItemDetalis";

const {
    getPeople,
    getPlanet,
    getStarship,
    getPersonImage,
    getPlanetImage,
    getStarshipImage
} = swapi


const PersonDetalis = ({itemId}) => {
    return (
        <ItemDetalis itemId={itemId} getData={getPeople} getImageUrl={getPersonImage}>
            <Record field='gender' label='Gender'/>
            <Record field='eyeColor' label='Eye Color'/>
        </ItemDetalis>
    )
};
const PlanetDetalis = ({itemId}) => {
    return (
        <ItemDetalis itemId={itemId} getData={getPlanet} getImageUrl={getPlanetImage}>
            <Record field='population' label='Population'/>
            <Record field='rotationPeriod' label='Rotation Period'/>
            <Record field='diameter' label='Diameter'/>
        </ItemDetalis>
    )
};
const StarShipDetalis = ({itemId}) => {
    return (
        <ItemDetalis itemId={itemId} getData={getStarship} getImageUrl={getStarshipImage}>
            <Record field='model' label='Model'/>
            <Record field='length' label='Length'/>
            <Record field='costInCredit' label='Cost'/>
        </ItemDetalis>
    )
};

export {
    PersonDetalis,
    PlanetDetalis,
    StarShipDetalis
}
